function getnamefromstart($str,$names){
    $_str = '';
    $result = [];
    
    for($i=0; $i<strlen($str); $i++){
        $_str .= $str[$i];
        
        
        
        if(strlen($_str) > 2){
            if(in_array($_str, $names)){
                $result[] = $_str;
            }
        }
    }
    
    return isset($result[0]) ? $result[0] : false;
}

